#include "EnginePrediction.h"
#include "NetVars.h"
#include "XorStr.hpp"
#include "Game.h""

BYTE bMoveData[200];

void start_prediction(CUserCmd* pCmd)
{
	auto LocalPlayer = game::localdata.localplayer();
	if (m_pMoveHelper && LocalPlayer->IsAlive())
	{

		float curtime = m_pGlobals->curtime;
		float frametime = m_pGlobals->frametime;
		int iFlags = LocalPlayer->GetFlags();

		m_pGlobals->curtime = (float)LocalPlayer->GetTickBase() * m_pGlobals->interval_per_tick;
		m_pGlobals->frametime = m_pGlobals->interval_per_tick;
		m_pMoveHelper->SetHost(LocalPlayer);

		m_pPrediction->SetupMove(LocalPlayer, pCmd, nullptr, bMoveData);
		m_pGameMovement->ProcessMovement(LocalPlayer, bMoveData);
		m_pPrediction->FinishMove(LocalPlayer, pCmd, bMoveData);

		m_pMoveHelper->SetHost(0);

		m_pGlobals->curtime = curtime;
		m_pGlobals->frametime = frametime;
		*LocalPlayer->GetPointerFlags() = iFlags;
	}
}

